// runSearch.js

export function runSearch() {
  const keywordsInput = document.getElementById("keywords");
  if (keywordsInput) {
    const keywords = keywordsInput.value;
    alert(`Search executed with keywords: ${keywords}`);
  } else {
    alert("Search executed!");
  }
}
